(ns thriving-sunshine
  (:require [com.evocomputing.rincanter :refer :all]
            [gorilla-repl.html :as h]
            [gorilla-plot.core :as p]))
(r-try-parse-eval "library(\"Cairo\")")
(r-try-parse-eval "Cairo(file=\"/tmp/gplot.svg\", type=\"svg\", bg=\"white\", dpi=70, width=600)")
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>#=(org.rosuda.REngine.REXP. org.rosuda.REngine.REXPInteger@682389ad+[1])</span>","value":"#=(org.rosuda.REngine.REXP. org.rosuda.REngine.REXPInteger@682389ad+[1])"}
