;; @@
(do
(r-eval "data(iris)")

;;create the plot using values from the iris dataset
(r-eval "plot(Sepal.Length ~ Sepal.Width, data = iris)")
;;alter this existing plot
(r-eval "title(main = \"Iris Sepal Measurements\")")

(r-eval "dev.off()")
(h/html-view (slurp "/tmp/gplot.svg")))

